contracts/generator.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

interface ISoulName {
    function mint(
        address to,
        string memory name,
        uint256 yearsPeriod,
        string memory _tokenURI
    ) external returns (uint256);
}

contract MyContract {
    ISoulName public soulNameContract;

    constructor(address _soulNameContract) {
        soulNameContract = ISoulName(_soulNameContract);
    }

    function mintSoulName(
        address to,
        string memory name,
        uint256 yearsPeriod,
        string memory _tokenURI
    ) external returns (uint256) {
        return soulNameContract.mint(to, name, yearsPeriod, _tokenURI);
    }
}

